measurements.description:
Seven flowers and one bud on one 56-cm arching, minimally staked, inflorescence;
 sepals eliptical,white, faintly streaked pink;
 petals orbicular, flat, light-pink venation;
 lip deep magenta, sidelobes streaked white proximally, midlobe tripartate, cirri curled, located distally,
 callus deep yellow, speckled magenta; column light pink, anther cap white; substance firm; texture crystalline.
